translations['es']['encryptionModalHeaderHowItWorks'] = "Cómo funciona Filen";
translations['es']['encryptionModalHowItWorksText'] = "Como ya sabrá, Filen es la forma más segura de almacenar archivos. ¿Pero como funciona? Bueno, es bastante simple. Cuando carga un archivo en el almacenamiento en la nube de Filen, en realidad no carga un archivo, carga fragmentos de texto cifrado. Antes de iniciar una carga, su navegador fragmenta su archivo en trozos de 1 MB, los cifra mediante el cifrado AES y luego envía la cadena cifrada a nuestros servidores. De esa manera, el archivo real nunca sale de su computadora. Incluso los nombres de archivo y los metadatos están cifrados. Al descargar un archivo, su navegador solicita todos los fragmentos del archivo de los servidores de Filen, los descifra utilizando la clave de descifrado y luego reconstruye el archivo completo nuevamente. De esta forma, puede estar seguro de que su archivo siempre estará seguro y nadie podrá leerlo a menos que tenga la clave de descifrado. Ni siquiera sabemos lo que has subido.";
